  false,\n\t\"url\": null,\n\t\"notes\": \"These data are part of Roberts, Richard
  W., University of Washington, Department of Oceanography Special Report No. 70,
  Bottom Sediment Granulometric Data for the Continental Margins of the Bering, Chukchi,
  East Siberian, Laptev, and Beaufort Seas. Data in the report represent granulometric
  analyses conducted by UW of over 4,300 sediment samples from approximately 1,500
  stations collected during cruises of the Brown Bear, Thomas G. Thompson, Northwind,
  Staten Island, Burton Island, Surveyor, John N. Cobb, and Drifting Ice Station Alpha
  II. The full report accompanying the tabular data is available in .pdf form online
  (27.4 Mbytes).Data include collecting institution, ship, cruise, sample id, latitude/longitude,
  date of collection, water depth, sampling device, method of analysis, sample weight,
  sampled interval, raw weight percentages of sediment, within a given phi range.
  Some samples also have percentages of total gravel, sand, silt, clay, and statistical
  measurements such as mean, median, skewness, kurtosis, and standard deviation of
  grain size. These data are also included in the NGDC Seafloor Sediment Grain Size
  Database (doi:10.7289/V5G44N6W).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
